 IF no_more_rows = 1 THEN
 LEAVE rally_loop;
 END IF;


-- calculation for 1 day

select a.SR_NO from engine_ea.market_sessions a
where    a.SESSION_DATE =   var_curr_date
into var_curr_sr_no;

select a.SESSION_DATE from engine_ea.market_sessions a
where    a.SR_NO =   var_curr_sr_no + 1
into var_target_date;

select a.AVERAGE_PRICE from   engine_ea.equity_data_main a
where a.CURR_DATE =  var_curr_date
and symbol = input_symbol
into var_curr_avg_price;

select a.AVERAGE_PRICE from   engine_ea.equity_data_main a
where a.CURR_DATE =  var_target_date
and symbol = input_symbol
into var_target_avg_price;

set var_one_day_current_confidence =  ((var_target_avg_price-var_curr_avg_price)
